import React, { setState, useEffect } from "react";
import "./VideoPlayer.css";

const VideoPlayer = ({ playback }) => {

    const exampleVideo = "Djrl6fu8myo";

    useEffect(() => {
        playback.isPlaying = 1;
    })
    
    function play() {
        playback.isPlaying = 1;
    }



    return (
        <div id="VideoControls">
            <iframe width="960" height="540" controls="0" src={"https://www.youtube.com/embed/" + exampleVideo + `?autoplay=${playback.isPlaying}&showinfo=0&controls=0&rel=0`}></iframe>
            <button id="PlayButton" className="text" onClick={play}></button>
        </div>
    )
}

export default VideoPlayer;
